*Hello*
Thanks to <@U15HY5TG8> you can now *plus*, *minus* and *keep score* of all the *good* and *not so good* things your friends say and do on Slack.
<http://plusplus.chat/images/plusplus_bgnd.png?1507040369.4914105>
*How*
```@user++   (awards a point)
@user--   (deducts a point)
@anything++   (awards a point)
@anything--   (deducts a point)
<@U72Q808MN> leaderboard   (shows the score)
<@U72Q808MN> help          (view help options)```
